prompt --application/deployment/install/install_add_user_to_acl
begin
wwv_flow_imp_shared.create_install_script(
 p_id=>wwv_flow_imp.id(1086310552623556086)
,p_install_id=>wwv_flow_imp.id(2224544913953427135)
,p_name=>'add user to ACL'
,p_sequence=>50
,p_script_type=>'INSTALL'
,p_script_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    username VARCHAR(50);',
'    l_id NUMBER;',
'BEGIN',
'',
'    SELECT USER_NAME INTO username FROM APEX_WORKSPACE_SESSIONS FETCH FIRST 1 ROWS ONLY;',
'    l_id := apex_application_install.get_application_id;',
'',
'    APEX_ACL.ADD_USER_ROLE (',
'        p_application_id  => l_id,',
'        p_user_name       => username,',
'        p_role_static_id  => ''ADMINISTRATOR''',
'    );',
'',
'END;'))
);
end;
